// PrivateRoute.js

import React from 'react';
 import { Navigate } from 'react-router-dom';

 function PrivateRoute({ authenticated, component: Component }) {
   return (
     authenticated ? Component : <Navigate to='/loginForm' />
   )
 }

 export default PrivateRoute
